import React from "react";
import { NavLink } from "react-router-dom";

const navbar = () => {
  return (
    <nav>
      <div className="nav-container">
        <div className="logo">
          <div className="logo">
            <NavLink exact to="/">
              <img src="./img/iconGus.png" alt="Logo-Gus" />
              <h3>The Gus Network</h3>
            </NavLink>
          </div>
        </div>
      </div>
    </nav>
  );
};

export default navbar;
